// frontend/src/App.js
import { BrowserRouter as Router, Routes, Route, NavLink, useNavigate, useLocation } from "react-router-dom";
import { useState, useEffect } from "react";
import Home from "./pages/Home";
import Login from "./pages/Login";
import Register from "./pages/Register";
import Dashboard from "./pages/Dashboard";
import MakePayment from "./pages/MakePayment";
import AdminDashboard from "./pages/AdminDashboard";
import CustomerNavbar from "./components/CustomerNavbar"; // IMPORTED
import "./App.css";

// --- NOTE: NavLink used instead of Link for active class functionality ---
const AuthStatus = () => {
    const [isLoggedIn, setIsLoggedIn] = useState(!!localStorage.getItem("token"));
    const role = localStorage.getItem("role");
    const navigate = useNavigate();
    const location = useLocation();

    useEffect(() => {
        // This watches local storage changes, which is good practice
        const handleStorageChange = () => {
            setIsLoggedIn(!!localStorage.getItem("token"));
        };
        window.addEventListener("storage", handleStorageChange);
        return () => window.removeEventListener("storage", handleStorageChange);
    }, []);

    const handleLogout = () => {
        localStorage.removeItem("token");
        localStorage.removeItem("role");
        setIsLoggedIn(false);
        navigate("/");
    };

    // --- CRITICAL FIX: Only hide the navbar if the user is NOT logged in AND on the root home page. ---
    // If a customer is logged in, the navbar must show on /dashboard and /make-payment.
    if (location.pathname === "/" && !isLoggedIn) {
        return null;
    }
    // For all other routes (like /login, /dashboard, /admin-dashboard), the navbar will now render.


    // --- Conditional Content Rendering Based on Role ---
    let navContent;
    if (isLoggedIn) {
        if (role === "admin") {
            navContent = (
                <>
                    {/* Admin Link: Use NavLink for highlighting */}
                    <NavLink 
                        to="/admin-dashboard" 
                        className={({ isActive }) => (isActive ? "nav-link active" : "nav-link")}
                    >
                        All Payments
                    </NavLink>
                    <button onClick={handleLogout} className="nav-button logout-btn">Logout</button>
                </>
            );
        } else if (role === "customer") {
            // Customer Links: Use the dedicated component
            // The CustomerNavbar component contains the links to /dashboard and /make-payment
            navContent = <CustomerNavbar onLogout={handleLogout} />; 
        } else {
             // Fallback for logged-in but unknown role
            navContent = <button onClick={handleLogout} className="nav-button logout-btn">Logout</button>;
        }
    } else {
        // Unauthenticated Links
        navContent = (
            <>
                <NavLink to="/login" className={({ isActive }) => (isActive ? "nav-link active" : "nav-link")}>Login</NavLink>
                <NavLink to="/register" className={({ isActive }) => (isActive ? "nav-link active" : "nav-link")}>Register</NavLink>
            </>
        );
    }
    // ---------------------------------------------------

    return (
        <nav className="navbar">
            <div className="nav-brand">International Payments</div>
            <div className="nav-links-container">
                {navContent}
            </div>
        </nav>
    );
};

function App() {
    return (
        <Router>
            <AuthStatus />
            <Routes>
                {/* Public Routes */}
                <Route path="/" element={<Home />} />
                <Route path="/login" element={<Login />} />
                <Route path="/register" element={<Register />} />

                {/* Customer Routes (Protected via logic inside components) */}
                <Route path="/dashboard" element={<Dashboard />} />
                <Route path="/make-payment" element={<MakePayment />} />

                {/* Admin Route (Protected via logic inside components) */}
                <Route path="/admin-dashboard" element={<AdminDashboard />} />
            </Routes>
        </Router>
    );
}

export default App;
